• ЦБ Азербайджана заявил, что российский Сбербанк участвует в сборе помощи для непризнанного Карабаха. Сбербанк ответил, что не оказывает помощи в политической деятельности, а все операции клиентов проверяет в рамках закона;

• Азербайджан прекратит дипломатические отношения с любой страной, которая признает Карабах, заявил Алиев;

• Лавров: Москва считает, что в Карабахе должны быть российские наблюдатели, но последнее слово за сторонами конфликта. Также он заявил, что в Карабахе нужно развернуть миротворцев;

• Алиев: Баку не исключает введения миротворцев в Карабах, это последний пункт в переговорном процессе

• Минобороны Азербайджана грозит уничтожить «все легитимные военные цели ВС Армении, взявшие под прицел гражданские объекты»

